                text: `A **JSONL** file (which stands for **JSON Lines**) is a text file format where each line represents a valid, independent JSON object.

Unlike a standard \`.json\` file, which contains one large data structure (usually an array of objects) spread over multiple lines, a \`.jsonl\` file puts exactly one object per line.

Here is a breakdown of how it works and why it is used.

---

### Visual Comparison

#### Standard JSON (\`.json\`)
In a standard JSON file, the entire file is one valid object. If you have a list of people, it looks like this:
\`\`\`json
[
  {"id": 1, "name": "Alice", "role": "admin"},
  {"id": 2, "name": "Bob", "role": "user"},
  {"id": 3, "name": "Charlie", "role": "user"}
]
\`\`\`
*Note the opening/closing brackets \`[]\` and the commas \`,\` separating the objects.*

#### JSON Lines (\`.jsonl\`)
In a JSONL file, there are no commas between lines and no surrounding brackets. Each line is its own self-contained JSON object.
\`\`\`json
{"id": 1, "name": "Alice", "role": "admin"}
{"id": 2, "name": "Bob", "role": "user"}
{"id": 3, "name": "Charlie", "role": "user"}
\`\`\`

---

### Key Rules of JSONL
1.  **Line Separation:** Each entry is separated by a newline character (\`\\n\`).
2.  **Valid JSON:** Each individual line must be a valid JSON value (usually an object or an array).
3.  **UTF-8:** The file is usually encoded in UTF-8.

### Why use JSONL instead of JSON?
JSONL is preferred in specific scenarios, particularly involving "Big Data" or logs.

**1. Stream Processing (Memory Efficiency)**
*   **Standard JSON:** To read a standard JSON file, the computer usually has to load and parse the *entire* file into memory to understand the structure (because of the enclosing brackets). If the file is 10GB, you need 10GB of RAM.
*   **JSONL:** You can read the file line-by-line. You process line 1, forget it, then process line 2. You can process a 1TB file with very little RAM.

**2. Easy Appending**
*   **Standard JSON:** To add a new record, you have to read the file, delete the closing \`]\`, add a comma, add the new record, and add the \`]\` back.
*   **JSONL:** You simply write the new data to the bottom of the file. This makes it perfect for **system logs**.

**3. Error Recovery**
*   **Standard JSON:** If there is a syntax error (like a missing comma) anywhere in the file, most parsers will fail to read the *entire* file.
*   **JSONL:** If one line is corrupt, you can simply skip that line and continue reading the rest of the file successfully.

### Common Use Cases
*   **Log Files:** Storing server activity logs where data is constantly being added.
*   **Big Data:** Processing massive datasets (e.g., using Apache Spark or Hadoop).
*   **Database Exports:** MongoDB exports data in this format by default.
*   **AI/ML Training:** OpenAI and other machine learning platforms often require training datasets to be uploaded in \`.jsonl\` format.

### How to Read It (Python Example)
Because it isn't "one big JSON object," you cannot use \`json.load()\` on the whole file. You must iterate through it:

\`\`\`python
import json

data = []
with open('data.jsonl', 'r') as f:
    for line in f:
        data.append(json.loads(line))
\`\`\``,
